        this._wordsList = [];
        this._wordsList = wordsList;
    }
    isWordInList(word) {
        for (let i = 0; i < this._wordsList.length; i++) {
            if (this._wordsList[i] == word) {
                return true;
            }
        }
        return false;
    }
    isOneLetterError(word) {
        for (let i = 0; i < word.length; i++) {
            for (let j = 0; j < this.alphabet.length; j++) {
                let newWord = word.replace(word.charAt(i), this.alphabet.charAt(j));
                if (this.isWordInList(newWord)) {
                    this.results.push(newWord);
                }
            }
        }
        return this.results;
    }
    isLettersReplaced(word) {
        for (let i = 0; i < word.length - 1; i++) {
            let arr = word.split("");
            [arr[i], arr[i + 1]] = [arr[i + 1], arr[i]];
            let newWord = '';
            for (let i = 0; i < arr.length; i++) {
                newWord += arr[i];
                if (this.isWordInList(newWord) == true) {
                    this.results.push(newWord);
                }
            }
        }
        return this.results;
    }
    separateWords(word) {
        let newWord = '';
        let i = 0;
        while (i < word.length) {
            newWord += word.charAt(i);
            let newString = word.substring(i + 1, word.length);
            if ((this.isWordInList(newWord) == true) && (this.isWordInList(newString) == true)) {
                this.results.push(newWord);
                this.results.push(newString);
            }
            i += 1;
        }
        return this.results;
    }
    findWordsFromList(word) {
        let newWord = '';
        let i = 0;
        while (i < word.length) {
            newWord += word.charAt(i);
            if (this.isWordInList(newWord)) {
                this.results.push(newWord);
                let newString = word.substring(i + 1, word.length);
                if (this.isWordInList(newString)) {
                    this.results.push(newString);
                }
            }
            i += 1;
        }
        return this.results;
    }
    putLetterBetween(word) {
        let newWord = "";
        for (let i = 0; i < word.length + 1; i++) {
            for (let j = 0; j < this.alphabet.length; j++) {
                newWord = word.slice(0, i) + this.alphabet[j] + word.slice(i, word.length);
                if (this.isWordInList(newWord)) {
                    this.results.push(newWord);
                }
            }
        }
        return this.results;
    }
    deleteLetter(word) {
        let newWord = '';
        for (let i = 0; i < word.length; i++) {
            if (this.isWordInList(newWord)) {
                this.results.push(newWord);
            }
            else {
                newWord = word.slice(0, 0) + word.slice(i + 1, word.length);
            }
        }
        return this.results;
    }
